import NavigationBar from './NavigationBar';

function ContactUs() {
  return (
    <div>
      <NavigationBar />
      <br />
      <h1>THIS IS CONTACT US PAGE</h1>
      <h2> CONTACT US PAGE INFORMATION</h2>
    </div>
  )
}

export default ContactUs
